import React from 'react';
import { Link } from 'react-router-dom';

import './BotonInicio.css'

export default function BotonInicio(props) {
    return ( 
        <>

                <Link to="/" className="btn-inicio">
                    {props.name}
                </Link>
                    </> 
        );
}
